import React from 'react';
import User from '../../models/User';
import ServerComponent from '../serverComponent/ServerComponent';
import './usersSquares.css';

export default function UsersSquares({filteredUsers} : any) {

    return (
        <div className="usersSquaresSection">
            <div className="squaresHeaderDiv">
                <h2>Users</h2>
            </div>
            <div className="allUsersSquares">
                {filteredUsers.map( (user : User, index : number) => 
                    <div key={index}>
                        <ServerComponent userDetails={user} />
                    </div>
                )}
            </div>
        </div>
    )
}
